import { Component } from 'react'
import tinytime from 'tinytime'
import styled from 'styled-components'
import Widget from '../../widget'

const urlImage = require("/static/dog");

const MyIcon = styled.img`
  width: 100px;
  height: auto;
`;
MyIcon.defaultProps = {
  src: urlImage
};

const MyIcon2 = styled.img.attrs(
  props => ({
    src: props.src || urlImage
  })
)`
  width: 100px;
  height: auto;
`;


const myLoader = ({ src, width, quality }) => {
  return `https://example.com/${src}?w=${width}&q=${quality || 75}`
}


export default class List extends Component {
  static defaultProps = {
    interval: 1000 * 10
  }

  componentDidMount () {
  }

  render () {
    const { title } = this.props
    return (
      <Widget title={title}>
        <Image
          loader={myLoader}
          src="me.png"
          alt="Picture of the author"
          width={500}
          height={500}
        />
        <MyIcon />
        <MyIcon2 />
      </Widget>
    )
  }
}
